create table execution_entity
(
    id             integer                                                    not null
        primary key autoincrement,
    workflowId     varchar(36)                                                not null
        constraint FK_c4d999a5e90784e8caccf5589de
            references workflow_entity
            on delete cascade,
    finished       boolean                                                    not null,
    mode           varchar                                                    not null,
    retryOf        varchar,
    retrySuccessId varchar,
    startedAt      datetime,
    stoppedAt      datetime,
    waitTill       datetime,
    status         varchar                                                    not null,
    deletedAt      datetime(3),
    createdAt      datetime(3) default (STRFTIME('%Y-%m-%d %H:%M:%f', 'NOW')) not null
);

create index IDX_execution_entity_deletedAt
    on execution_entity (deletedAt);

create index IDX_execution_entity_stoppedAt
    on execution_entity (stoppedAt);

